import CommentBox from "./CommentBox.js";
import RecommendButton from "./RecommendButton.js";

// Json객체로부터 데이터 불러오는 함수
export function loadcommentsJsonToList(comments) {
  if (comments) {
    var comment_list = [];
    for (var key in comments) {
      comment_list.push(
        <div>
          <CommentBox isReadOnly={false} content={comments[key].contents}></CommentBox>
          <RecommendButton fixed={true} value={comments[key].recommend}></RecommendButton>
        </div>
      );
    }
    return comment_list;
  }
}
